	add("clunker", "{\"term\":\"clunker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|clunk|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A decrepit motor car\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Teralee E. M. Bird, \u0027What the Herald Angel Sang\u0027 (Seraphim Trilogy Book One), ISBN 9781411617216\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The only rig nobody\u0027d recognize is that \u0027\u0027clunker\u0027\u0027 that Vic drove here in, and he won\u0027t take it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Anything which is in poor condition or of poor quality\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, w:Erma Erma Bombeck, \u0026quot;[http://news.google.com/newspapers?id\u003dyyoTAAAAIBAJ\u0026amp;sjid\u003digUEAAAAIBAJ\u0026amp;pg\u003d7135,581583\u0026amp;dq\u003dclunker+-car+-truck+-vehicle+-automobile+-drove+-drive+-cash Who\u0027s Been Playing At Erma\u0027s Typewriter?],\u0026quot; \u0027Ocala Star-Banner\u0027, 3 Oct., p. 12A (retrieved 2 Sep. 2009\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I bought an old \u0027\u0027clunker\u0027\u0027 of a typewriter\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Elizabeth Crane, \u0026quot;[http://chicago.timeout.com/articles/books/18245/indelible-markers Books: Best book by a Chicago author]\u0026quot; (Review of \u0027Trouble\u0027 by Patrick Somerville), \u0027Time Out Chicago\u0027, 28 Dec. (retrieved 2 Sep. 2009\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"All of the stories have a subtle undercurrent of brutality, and the writing is consistently sharp, direct and darkly funny, and there’s not a \u0027\u0027clunker\u0027\u0027 in the bunch\", \"priority\":8}]}, \"synonyms\":{}}");

