	add("cluster", "{\"term\":\"cluster\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Icelandic\", \"low german\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027cluster\u0027 from Old english (ca. 450-1100) \u0027cluster\u0027 \u0027clyster\u0027 (cluster, bunch, branch) from Proto-germanic {{m|gem-pro|*klus-}}, {{m|gem-pro|*klas-||to clump, lump together}} + Proto-germanic {{m|gem-pro|*-þrą|pos\u003dinstrumental suffix}}, related to Low german \u0027kluuster\u0027 (cluster) Dutch dialectal \u0027klister\u0027 (cluster) Swedish \u0027kluster\u0027 (cluster) Icelandic \u0027klasi\u0027 (cluster; bunch of grapes)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group or bunch of several discrete items that are close to each other\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027cluster\u0027\u0027 of islands\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Her deeds were like great \u0027\u0027clusters\u0027\u0027 of ripe grapes, / Which load the bunches of the fruitful vine\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dEarless ghost swift moths become “invisible” to echolocating bats by forming mating \u0027\u0027clusters\u0027\u0027 close (less than half a meter) above vegetation and effectively blending into the clutter of echoes that the bat receives from the leaves and stems around them\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A number of individuals grouped together or collected in one place; a crowd; a mob\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"As bees / Pour forth their populous youth about the hive / In \u0027\u0027clusters\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"We loved him; but, like beasts / And cowardly nobles, gave way unto your \u0027\u0027clusters\u0027\u0027, / Who did hoot him out o\u0027 the city\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A group of galaxies or stars that appear near each other\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A secundal chord of three or more notes\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A group of consonants\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A group of computers that work together\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A logical data storage unit containing one or more physical sectors (see block\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A significant subset within a population\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Set of bombs or mines\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A small metal design that indicates that a medal has been awarded to the same person before\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"An ensemble of bound atoms or molecules, intermediate in size between a molecule and a bulk solid\", \"priority\":19}]}, \"synonyms\":{}}");

	add("clusterfuck", "{\"term\":\"clusterfuck\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Reportedly coined in the 1960s by w:Hippie|hippie poet w:Ed Sanders|Ed Sanders as \u0027Mongolian Cluster Fuck\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chaotic situation where everything seems to go wrong. It is often caused by incompetence, communication failure, or a complex environment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, w:Clint Clint Eastwood, \u0027w:Heartbreak Heartbreak Ridge\u0027, IMDB tt0091187, [http://www.imdb.com/title/tt0091187/ tt0091187\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When asked how he thought the military exercise went, Highway responded, \u0026quot;It\u0027s a \u0027\u0027cluster fuck\u0027\u0027. \u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027: P. J. O\u0027Rourke, \u0027Holidays in Hell\u0027 \u0026lt;SUP\u0026gt;\u0026lt;I\u0026gt;p. 216\u0026lt;/I\u0026gt;\u0026lt;/SUP\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Mongolian Cluster Fuck\u0027\u0027\u0026quot; is the technical term journalists use for a preplanned, wholly scripted, news-free event\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, w:Stephen Stephen King, \u0027Dark Half\u0027, ISBN 0451167317, [http://books.google.com/books?id\u003dv0Zd99d0xLkC\u0026amp;q\u003d%22cluster+fuck%22+date:0-1994\u0026amp;dq\u003d%22cluster+fuck%22+date:0-1994\u0026amp;pgis\u003d1 p. 151\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They had a name for something like this in the army—a \u0027\u0027cluster fuck\u0027\u0027. Yes. Good name. ... He was sitting here in the middle of a great big \u0027\u0027cluster fuck\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027: James O\u0027Barr / Alex Proyas, \u0027The Crow\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A simple sweep-and-clear turned into a total \u0027\u0027clusterfuck\u0027\u0027\u0027: T-Bird, trying to explain to Eric how the situation escalated on Devil\u0027s Night\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027: John Barnes, \u0027Mother of Storms\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Please note also my request that henceforth I wish to be reminded of the possibility of a \u0027\u0027clusterfuck\u0027\u0027 in any contingency plan or operations proposal\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Ray Kopp, \u0027Thunder in the Night: A Sailor\u0027s Perspective on Vietnam\u0027, ISBN 189245128X, [http://books.google.com/books?id\u003dT53y42RaR7cC\u0026amp;pg\u003dPA87\u0026amp;ots\u003dyJpU0kl8BL\u0026amp;dq\u003d%22cluster+fuck%22+intitle:thunder\u0026amp;sig\u003d0FGfLgiGEP3Yu9JQe1KsDjzwDKw p. 87\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"My cousin was in the Army over here in \u002768. He says don\u0027t trust anybody to know what they\u0027re doing, calls it a \u0027\u0027cluster-fuck\u0027\u0027. Fucked-up-beyond- all-repair, FUBAR he says\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: Jon Stewart, \u0027America (The Book): A Citizen\u0027s Guide To Democracy Inaction\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"and you will still only begin to get a sense of the constitutionally mandated \u0027\u0027clusterfuck\u0027\u0027 that is the modern presidency\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: Charles W. Sasser, \u0027Patton\u0027s Panthers: The African-American 761st Tank Battalion in World War II\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"It was a \u0027\u0027clusterfuck\u0027\u0027, a deadly \u0027\u0027clusterfuck\u0027\u0027. When the doughs finally got off the ground in some numbers and charged into the woods, the Krauts broke contact\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, w:Coen Ethan Coen, Joel Coen, \u0027w:Burn After Burn After Reading\u0027, IMDB tt0887883, [http://www.imdb.com/title/tt0887883/ tt0887883\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"In the last sequence the CIA-Superior summarized the highly complex events/mess: \u0026quot;Jesus, what a \u0027\u0027clusterfuck\u0027\u0027. \u0026quot\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027: Barbara Kruger: \u0027What a ridiculous \u0027\u0027clusterfuck\u0027\u0027 of totally uncool jokers. I make my work about this kind of sadly foolish farce. I’m waiting for all of them to sue me for copyright infringement\u0027 in response to the \u0027\u0027Supreme\u0027\u0027 v \u0027\u0027Married To The Mob\u0027\u0027 battle\", \"priority\":20}]}, \"synonyms\":{}}");

	add("clutter", "{\"term\":\"clutter\", \"etymology\":{\"influencers\":[], \"languages\":[\"Welsh\"], \"text\":\"Compare Welsh \u0027cludair|lang\u003dcy\u0027 () \u0027cludeirio|lang\u003dcy\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A confused disordered jumble of things\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"L\u0027Estrang\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He saw what a \u0027\u0027clutter\u0027\u0027 there was with huge, overgrown pots, pans, and spits\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dNonetheless, some insect prey take advantage of \u0027\u0027clutter\u0027\u0027 by hiding in it. Earless ghost swift moths become “invisible” to echolocating bats by forming mating clusters close (less than half a meter) above vegetation and effectively blending into the \u0027\u0027clutter\u0027\u0027 of echoes that the bat receives from the leaves and stems around them\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Clatter; confused noise\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Background echos, from clouds etc., on a radar or sonar screen\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A group of cats\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, John Robert Colombo, \u0027The Big Book of Canadian Ghost Stories\u0027, Introductio\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Organizing ghost stories is like herding a \u0027\u0027clutter\u0027\u0027 of cats: the phenomenon resists organization and classification\", \"priority\":9}]}, \"synonyms\":{}}");

